import React from "react";
import About from "./About";
import Contact from "./Contact";
import {Route, Routes} from "react-router-dom";

 const App = () =>{
  return(
    <>
    <Routes>
      <Route exact  path='/about' element={<About />} />
      <Route  path='/contact' element={<Contact />} />
    </Routes>
    </>
  );
}

export default App;
